    <script>
        // JavaScript for Validation

        const fromDateInput = document.getElementById('dateFrom');
        const toDateInput = document.getElementById('dateTo');
        const dateError = document.getElementById('dateError');

        function validateDates() {
            const fromDate = new Date(fromDateInput.value);
            const toDate = new Date(toDateInput.value);

            // Check only if both dates are valid
            if (fromDateInput.value && toDateInput.value && toDate < fromDate) {
                dateError.classList.remove('hidden');
            } else {
                dateError.classList.add('hidden');
            }
        }

        // Add event listeners
        fromDateInput.addEventListener('change', validateDates);
        toDateInput.addEventListener('change', validateDates)


        // Revenue Chart Card
        document.addEventListener('DOMContentLoaded', () => {
            const ctx = document.getElementById('revenueChart').getContext('2d');

            // Data estimated from the image
            const revenueData = [100, 200, 400, 700, 300, 550, 600];
            const maxRevenue = 1000; // Assuming a max value to create the stack
            const remainingData = revenueData.map(val => maxRevenue - val);
            const labels = ['Mon', 'Tue', 'Wed', 'Thu', 'Fri', 'Sat', 'Sun'];

            new Chart(ctx, {
                type: 'bar',
                data: {
                    labels: labels,
                    datasets: [
                        {
                            label: 'Revenue',
                            data: revenueData,
                            backgroundColor: '#E9770D', // Orange color from image
                            borderColor: 'rgba(0,0,0,0)',
                            borderWidth: 0,
                            borderRadius: 8,
                            borderSkipped: false,
                        },
                        {
                            label: 'Remaining',
                            data: remainingData,
                            backgroundColor: '#F3F4F6', // Light grey background
                            borderColor: 'rgba(0,0,0,0)',
                            borderWidth: 0,
                            borderRadius: 8,
                            borderSkipped: false,
                        }
                    ]
                },
                options: {
                    responsive: true,
                    maintainAspectRatio: false,
                    plugins: {
                        legend: {
                            display: false // Hide the legend
                        },
                        tooltip: {
                            enabled: true,
                            mode: 'index',
                            intersect: false,
                            callbacks: {
                                // Show only the 'Revenue' tooltip
                                filter: function (tooltipItem) {
                                    return tooltipItem.datasetIndex === 0;
                                }
                            }
                        }
                    },
                    scales: {
                        x: {
                            stacked: true, // Stack the bars
                            grid: {
                                display: false, // Hide x-axis grid lines
                                drawBorder: false
                            },
                            ticks: {
                                font: {
                                    family: "'Instrument Sans', sans-serif",
                                    size: 12
                                },
                                color: '#5D6772' // Icon title color for labels
                            }
                        },
                        y: {
                            stacked: true, // Stack the bars
                            beginAtZero: true,
                            max: maxRevenue,
                            grid: {
                                display: true,
                                drawBorder: false,
                                drawOnChartArea: true,
                                color: '#E5E7EB', // Dotted line color
                                borderDash: [4, 4], // Make lines dotted
                            },
                            ticks: {
                                display: false, // Hide y-axis labels
                                stepSize: 200
                            }
                        }
                    },
                    elements: {
                        bar: {}
                    },
                    // Use a thinner bar
                    categoryPercentage: 0.6,
                    barPercentage: 0.7
                }
            });
        });
