        // Stats Chart Card
        document.addEventListener('DOMContentLoaded', function () {
            const ctx = document.getElementById('statsChart').getContext('2d');

            const statsChart = new Chart(ctx, {
                type: 'doughnut',
                data: {
                    // FIXED: Labels to match the 4 slices
                    labels: [
                        'Amazon',
                        'Wayfare',
                        'Myntra',
                        'Ajio',
