                        borderWidth: 0, // No borders on slices
                        hoverOffset: 4
                    }]
                },
                options: {
                    responsive: true,
                    maintainAspectRatio: true,
                    cutout: '70%', // Makes it a doughnut chart
                    rotation: -90, // Starts the chart at 9 o'clock
                    circumference: 180, // Makes it a semi-circle
                    plugins: {
                        legend: {
                            display: false // Hide default legend
                        },
                        tooltip: {
                            enabled: true, // Re-enabling tooltips as they are useful
                            backgroundColor: '#333',
                            titleColor: '#fff',
                            bodyColor: '#fff',
                            padding: 10,
                            displayColors: false,
                            callbacks: {
                                label: function(context) {
                                    return `${context.label}: ${context.raw}%`;
